import React from 'react';
import ReactDOM from 'react-dom';
import {HomePage} from './page';
import 'normalize.css';
import './style.scss';
import {Helmet} from "react-helmet";

ReactDOM.render(
    <React.StrictMode>
        <Helmet>
            <title>{window.localStorage.title || ""}</title>
        </Helmet>
        <HomePage />
    </React.StrictMode>,
    document.getElementById('root')
);
